import React from 'react';

const skillCategories = {
  "Programming Languages": ["Python", "Java", "JavaScript", "SQL"],
  "AI/ML Tools": ["Machine Learning", "NLP", "Computer Vision", "TensorFlow", "Scikit-learn", "Keras", "PyTorch", "Pandas", "NumPy", "Matplotlib"],
  "Frameworks": ["Next.js", "Node.js", "React.js", "Express.js"],
  "Databases": ["MySQL", "PostgreSQL", "MongoDB", "SQLite", "Neon Console"],
  "Web Development": ["MERN Stack", "HTML5", "CSS3", "Tailwind CSS"],
  "DevOps & Cloud": ["MLOps", "AWS", "Azure", "GCP", "Docker"],
  "Other Tools": ["Git", "GitHub", "REST APIs", "Power BI"],
};

const Skills = () => {
  return (
    <section id="skills" className="py-20 bg-dark-bg text-light-text">
      <div className="container mx-auto px-4">
        <h2 className="text-4xl font-bold text-center mb-12">Technical Skills</h2>
        <div className="max-w-4xl mx-auto">
          {Object.entries(skillCategories).map(([category, skills]) => (
            <div key={category} className="mb-8 animate-fade-in-up">
              <h3 className="text-2xl font-semibold text-primary mb-4">{category}</h3>
              <div className="flex flex-wrap gap-3">
                {skills.map((skill) => (
                  <span
                    key={skill}
                    className="bg-dark-card text-dark-text px-4 py-2 rounded-full shadow-md hover:bg-gray-700 transition-colors"
                  >
                    {skill}
                  </span>
                ))}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Skills;
